class MODPlayProcessor extends AudioWorkletProcessor {
	constructor(options) {
		super();

		this.playing = false;

		this.port.onmessage = this.handleMessage.bind(this);

		this.songbuffer = 0;
		this.audiobuffer = 0;
		this.statusptr = 0;
		this.audiofreq = options.processorOptions.audiofreq;
		
		this.orderreq = null;
		this.speedreq = null;
		this.mutereq = null;
	}

	handleMessage(event) {
		console.log(event);

		switch(event.data.message) {
			case "init":
				this.playing = false;

				if(this.songbuffer) Module._free(this.songbuffer);

				this.songbuffer = Module._malloc(event.data.songdata.length);

				if(!this.audiobuffer) this.audiobuffer = Module._malloc(128 * 4); // Let's just hope this constant never changes, as I cannot access in any seeming way

				Module.HEAPU8.set(event.data.songdata, this.songbuffer);

				if(this.statusptr = Module.ccall('InitMOD', 'number', ['number', 'number'], [this.songbuffer, this.audiofreq])) {
					this.port.postMessage({ message: "succ", data: new Uint8Array(Module.HEAPU8.subarray(this.songbuffer, this.songbuffer + event.data.songdata.length)), status: {
						buffer8: new Uint8Array(Module.HEAPU8.subarray(this.statusptr, this.statusptr + 828)),
						buffer16: new Int16Array(Module.HEAP16.subarray(this.statusptr / 2, this.statusptr / 2 + 414)),
						buffer32: new Int32Array(Module.HEAP32.subarray(this.statusptr / 4, this.statusptr / 4 + 207))
					} });
				} else {
					this.port.postMessage({ message: "fail" });
				}
				break;

			case "rw":
				this.orderreq = -2;
				break;

			case "ff":
				this.orderreq = -1;
				break;

			case "reset":
				this.playing = false;
				Module.ccall('JumpMOD', 'number', ['number'], [0]);
				this.port.postMessage({ message: "reset" });
				break;

			case "stop":
				this.playing = false;
				this.port.postMessage({ message: "stop" });
				break;

			case "play":
				this.playing = true;
				this.port.postMessage({ message: "play" });
				break;

			case "speed":
				this.speedreq = Module.HEAP32.subarray(this.statusptr / 4 + 6, this.statusptr / 4 + 7)[0] + event.data.incr;
				break;

			case "mute":
				this.mutereq = event.data.ch;
				break;
		}
	}
	
	process(inputs, outputs, parameters) {
		const output = outputs[0];

		if(this.speedreq != null) {
			if(this.speedreq > 0 && this.speedreq < 32) {
				Module.HEAP32.set(new Int32Array([this.speedreq]), this.statusptr / 4 + 6);
			}

			this.speedreq = null;
		}

		if(this.orderreq != null) {
			Module.ccall('JumpMOD', 'number', ['number'], [this.orderreq]);

			this.orderreq = null;
		}

		if(this.mutereq != null) {
			var ptr = 748 + 19 + this.mutereq * 20;

			var buffer8 = Module.HEAPU8.subarray(this.statusptr, this.statusptr + 828);

			Module.HEAPU8.set(new Uint8Array([buffer8[ptr] ^ 1]), this.statusptr + ptr);

			this.mutereq = null;
		}

		if(this.playing) {
			Module.ccall('RenderMOD', 'number',
				['number', 'number'],
				[this.audiobuffer, output[0].length]);

			var rawbuffer = Module.HEAP16.subarray(this.audiobuffer / 2, this.audiobuffer / 2 + output[0].length * 2);

			for(var ch = 0; ch < output.length; ch++) {
				for (let i = 0; i < output[ch].length; i++) {
					output[0][i] = rawbuffer[i * 2] / 32768;
					output[1][i] = rawbuffer[i * 2 + 1] / 32768;
				}
			}

			this.port.postMessage({
				message: "status",
				buffer8: new Uint8Array(Module.HEAPU8.subarray(this.statusptr, this.statusptr + 828)),
				buffer16: new Int16Array(Module.HEAP16.subarray(this.statusptr / 2, this.statusptr / 2 + 414)),
				buffer32: new Int32Array(Module.HEAP32.subarray(this.statusptr / 4, this.statusptr / 4 + 207))
			});
		} else {
			for(var ch = 0; ch < output.length; ch++) {
				for (let i = 0; i < output[ch].length; i++) {
					output[ch][i] = 0;
				}
			}
		}

		return true;
	}
}

registerProcessor('modplay_processor', MODPlayProcessor);
